import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import screenLoader from "../images/a.gif";
import HouseRentAction from "../store/Actions/HouseRentAction";
import "../StyleSheet/HouseList.css";
import { Link } from "react-router-dom";
const ForRent = () => {
  
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(HouseRentAction());
  }, []);
  return (
    <div className="Houses__container">
      {
        <div className="Container">
          <h3>Houses To Rent</h3>
          <div className="listedHouses">
            {rentHouses.map((house) => {
              return (
                <div className="House__details" key={house._id}>
                 <div className="img-conatiner">
                   
                   <img src={house.house_details.house_image} alt="House Picture" />

               </div>
                  <div className="House__priceAndDetails">
                  <h4 className="House__price">HOUSE PRICE : ${house.house_details.price}</h4>
  <h4 className="House__snipDescription">{house.house_details.numOfBedRooms} BHK</h4>
  <h4 className="House__snipDescription">Area : {house.house_location.province}</h4>

                  </div>
                </div>
              );
            })}
          </div>
        </div>
      }
    </div>
  );
};

export default ForRent;
